import React from 'react';
import Map from './components/Map/Map';

function App() {
    return (
        <div className="min-h-screen bg-gray-100">
            {/* Navigation Bar */}
            <nav className="bg-blue-600 p-4 shadow-lg">
                <div className="container mx-auto flex justify-between items-center">
                    <h1 className="text-2xl font-bold text-white">Find your Vote NJ</h1>
                    <div className="flex space-x-6">
                        <a href="/" className="text-white hover:text-blue-200 transition">Home</a>
                        <a href="/about" className="text-white hover:text-blue-200 transition">About</a>
                    </div>
                </div>
            </nav>

            <div className="flex p-4">
                {/* Left side content */}
                <div className="w-1/2 p-4">
                    <h1 className="text-2xl font-bold mb-4">Find Your Vote NJ</h1>
                    <p>Select a district to see your representatives</p>
                </div>

                {/* Right side map */}
                <div className="w-1/2 p-4">
                    <Map />
                </div>
            </div>
        </div>
    );
}

export default App;
